import React from 'react';
import '../css/header.css';

function Header() {
    return (
        <header className="container-fluid">
            <div className='row'>
                <div className="col-md-8">
                    <h1>Company Name!</h1>
                    <h2>TRMS</h2>
                </div>
                <div className="col-md-4">
                    <h3>Login</h3>
                </div>
            </div>
        </header>
      );
}

export default Header;
